values:
I spent over a month and a half building a character in Morrowind for pc.&nbsp; I built this character to where he was a level 32 Nord, born under the Sign "The Tower," and he had Ebony Armor (and was on his way to having Daedric Armor), had a FUCKIN' BADASS Daedric Greatsword, then the save file gets corrupted.&nbsp;&nbsp; 

*about five minutes of nonstop cursing, the first 3 minutes containing forms of explitives that most people have never before heard*

Lemme explain what'd happened:

In Morrowind (even with God Mode activated), your character can still contract Common and Blight Diseases from fighting diseased animals.&nbsp; Well, I was fighting a shitload of Corpus Stalkers (think diseased, but still BARELY alive, zombies), and contracted "Black-Heart Blight" disease.&nbsp; Instead of the usual "just use a Cure Blight Potion" method, I go a lil hypochondriac, JUST TO MAKE SURE (bc, I've done it all the time and ALWAYS works).&nbsp; This is what I cured myself with:

*5 potions of "Disease Resistance" (2 Bargain, 1 Cheap, 2 Quality)
*1 potion of "Cure Blight Disease"
*1 potion of "Cure Common Disease"
* Cyrodillic Brandy (Forifies Endurance and Willpower)
* Flin (Fortifies Strength and Endurance)
*2 (not 1, but TWO) Scrolls of "Purity of Body"&nbsp; 

Well, it showed that I was Cured, so after about 5 minutes, it still showed me as Cured, so I went ahead and saved.&nbsp; Well, yesterday, I open the saved file, and it showed me as having "Black-Heart Blight",&nbsp; I Hypochondriac'd YET AGAIN, but this time after a minute.&nbsp; It showed me as STILL being infected with that fucking Blight disease!!!&nbsp; So, out of pure RAGE, I uninstalled the ENTIRE game, and all the save games.&nbsp; A month and a half, down the drain, bc of a fucking corrupted save file!!&nbsp; 

Hopefully, if I buy Oblivion, these fucking problems won't be in it.&nbsp; I still have to buy the two expansion sets to Morrowind (Tribunal and Bloodmoon).&nbsp; But for the time being, I'm taking a lil time off of Morrow-crack, and maybe playing Judge Dredd: Dredd vs Death, or UT 2k4 again.&nbsp;

Things have been "Unique" to say the least, lately.&nbsp; The power supply to the Ultra-Beast blew out, and it took UPS(hit) over two days to deliver a replacement that was sent via overnight (which means it's supposed to arrive by 10:30am the next morning, not 3pm, two days later).&nbsp; But, it arrived, so I'm just glad the Ultra-Beast is up and running again.&nbsp; 

On another computer-related note, about two days after my last regular LJ entry, my brother actually found a laptop computer for me.&nbsp; He works for Ray's trash, and was working the Carmel route (so yeah, richie-ass waste-shits).&nbsp; Hell, the ONLY thing wrong with this laptop is that the battery doesn't seem to hold a charge.&nbsp; It works PERFECTLY when connected to the powerbrick.&nbsp; It's a Dell Latitude CP-x model laptop.&nbsp; The quick specs:
500mhz&nbsp; P3 processor
128mb memory (upgradeable to 512mb)
6GB hard drive (thinking of replacing with a larger hard drive)
Windows ME (another reason for upgrading to a larger hard drive.&nbsp; LOL)

Other than the minor inconvenience with the battery, it works PERFECTLY!!&nbsp; Hell, it even came with a modular swap-out floppy drive, the powerbrick, owner's manual, and alot of other stuff!!&nbsp; What does urk me is that the previous owner was as foolishly wasteful as he/she was.&nbsp; Hell, instead of donating it to a school, charity, Good-Will, or even Dell's pc recycling program, they just simply cleaned the system and shitcanned it.&nbsp; Well, hey, at least I have a school computer now.&nbsp; ^_^

Lately, I've been feeling pretty pissed off.&nbsp; I've been exhibiting Road Rage like beyond belief.&nbsp; Hell, last wknd, I almost got into a fight with some douchebag at Kroger's here in Pissfield.&nbsp; I dunno if it's just me being subconsciously anxious about college in the fall, repressed anger from wrongfully losing my job, or whatever.&nbsp; Maybe I just needta start lifting again.&nbsp; That always seemed to help and do me some good.&nbsp; It's been over 2 yrs now, so yeeeeeeah.&nbsp; I really needta hit the weights, bad.&nbsp; 

But yes, I forgot to mention, I do begin college again in the Fall.&nbsp; So BOOYAH!!!&nbsp; Hell, ALOT of friends from college (before I hadta leave), and friends from LARPing are excited to see my big ass on campus again!!&nbsp; I'm excited!&nbsp; I get to finish my degree, and flirt with some hot ladies.&nbsp; LOL&nbsp; 

Also,&nbsp; I've been feeling the Siren's call of music hit me again these past few months.&nbsp; I've been wanting to relearn guitar badly.&nbsp; Maybe it's just me seeing how the state of hard rock/heavy metal is in a piss-poor coma of a state.&nbsp; Sorry, that's my opinion.&nbsp; It's just that, instead of seeing groups making music that inspires, empowers, enriches&nbsp; listeners' lives, I've been seeing cookie-cutter groups just "going through the motions."&nbsp; I'm tired of seeing Mtv (when the RARELY do play music anymore) push these emo/screamo/hipster groups down everyones' throats, and claim that it's "rock n roll."&nbsp; 

To me, rock n roll is NOT about a bunch of androgynous twerps singing "Dance, Dance," making out with other guys "'cause the girls like it" (Caleb will get that inside joke), and slitting their wrists (bc of some girl/guy that they just met, but is "so beautiful," that they're willing to die for them).&nbsp; ::Rolls Eyes:::&nbsp; To me, Rock 'N Roll is about rebellion.&nbsp; It's about grabbing the listener, and hitting them with an energy that makes them feel empowered.&nbsp; 

With me, I want to build a band again.&nbsp; I want to make music that does what PanterA did for me......&nbsp; Grabbed me by my throat, and hit me with an energy that made me feel empowered to face the world, give it a big "Fuck You," and bullcharge right at it head-on with NO fear whatsoever.&nbsp; I want to make the listener feel like they can take on anything, and succeed.&nbsp; I want the 98lb "weakling" to not fear marching into a moshpit proudly.&nbsp; I want that kid that sits alone at lunch to be proud that he's not one of the "sheeple", and can PROULDLY think for himself.&nbsp; I want that loner, ostracized by everyone, to have the inner strength to look at every challenge before him/her, and to know that he/she will not give up until he/she has succeeded.&nbsp; Yes, I was THAT underdog growing up, but I'm DAMN proud I was the underdog.&nbsp; I want people out there, in their darkest hour, to be able to know that someone has been through what they've been through, and that fact being the spark that gives them the inner-strength to fight on, against all odds.&nbsp; 

Yes, I'm extremely passionate about music.&nbsp; I'm tired, and it's late.&nbsp; I better head to sleep, bc I have a shitload of chores to finish tomorrow.&nbsp; 'Nite
